            WriteLiteral(@"trong>《情深无觅处徐若思》 第2章 算账 免费试读</strong></p>
                    <p>这一巴掌极重，打的徐若思牙齿都松了，口中也有血沿着嘴角溢出。</p><p>抬眸愣愣的看着楚渊把林珑扶起来，小心翼翼的问她是否有伤着。</p><p>那温柔小意的样子，像一把利箭刺入了徐若思的眼睛，也戳进了她的心。</p><p>她的相公，在她的面前，握住别的女人的手，小心翼翼的呵护，他的一只手搂住林珑的腰，他的眼睛不忍的看着林珑的手。</p><p>仿佛他们才是一对。</p><p>那她呢，她算什么？</p><p>徐若思张张嘴，血沿着嘴角流出，她想问几句。</p><p>“王爷，表姐还在呢！”林珑娇羞低语。</p><p>“她在就在吧，以后她迟早要适应我们的相处！”楚渊低语。</p><p>连一眼都不曾施舍给徐若思。</p><p>“王爷，人家，人家害羞！”林珑说着，抬手捶了捶楚渊的胸口。却被楚渊抓住。</p><p>轻轻的咬了一口。</p><p>然后楚渊拦腰打横抱起了林珑，大步朝她的屋子走去。</p><p>她的屋子。</p><p>徐若思有种心被人凌迟的疼痛。</p><p>跌跌撞撞走过去，在门口就听到屋子里传出来的声音，那么的娇媚。</p><p>她知道那是什么声音，那是男女欢爱的声音。</p><p>他们一定是在骗她的吧。</p><p>徐若思想着，迈步走了进去。</p><p>两具赤裸的身体，交缠着，他们真的做了。</p><p>而这些日子，在这张大床上，楚渊也这样子对她。</p><p>“呵！”</p><p>“呵呵！”</p><p>徐若思悲戚一笑，泪如雨下。</p><p>更觉得腹部剧痛。</p><p>有股子温热从大腿一直流了下去。</p><p>她知道，又一个孩子没了。</p><p>没了。</p><p>这一次没有喝药，没有不甘心。</p><p>因为她压根不知道他存在，就这样子没了。</p><p>“为什么这样子对我，为什么这样子对我，我做错了什么？”徐若思哭着。</p><p>低吼着。</p><p>若是不喜欢她，为什么要在那一年，桃花盛开的时候，在挑花树下与她相见，后来的一次次相会，琴瑟和鸣，难道都是一场场骗局？</p><p>一路走，一路血。</p><p>丫鬟婆子尖叫出声，“王妃娘娘……”</p><p>“来人呐，王妃娘娘小产了！”</p><p>可是，徐若思知道，在她晕过去之前，楚渊都没有出来。</p><p>或许他");
            WriteLiteral(@"觉得，他现在做的事情，比他的孩子还要重要。</p><p>如若不然，又怎么会让她连着没了五个孩子。</p><p>……</p><p>“啪！”</p><p>徐若思疼的醒了过来。</p><p>有些迷茫的看着床顶。</p><p>这不是她在王府的床，是什么地方？</p><p>“醒了！”楚渊冷冷的声音传来。</p><p>徐若思才看清楚了她。</p><p>刚刚是他打她吗？</p><p>“醒了就好，我们该好好的算算账了！”楚渊说着，见徐若思拉了起来。</p><p>徐若思身体还很虚弱，被他这么一拉扯，一下子被摔到了床下。</p><p>疼的她满头大汗，一句话都说不出来。</p><p>“说吧，当年为什么那样子对佳怡！”楚渊沉声。</p><p>看着徐若思这样子，再没了曾经的温柔。</p><p>也没有了曾经的耐心。</p><p>尤其是前朝，徐家各种施压，要他立徐若思为皇后。</p><p>这个蛇蝎毒妇，有什么资格做他的皇后。</p><p>“佳怡？”徐若思蹙眉。</p><p>佳怡不是死了吗？</p><p>被人侮辱至死，等到尸体被抬回来，她身上的伤痕，让人见了都于心不忍。</p><p>“是，佳怡，你说，为什么要那样子对她？”楚渊阴霾着脸，眸子里都是浓烈的恨意。</p>
